package selenium;

public class JavaBreak {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a = 10;
		
		for(int i=0; i<=a;i++) {
			if(i==5) {
				continue;
				
			}System.out.println(i);
			if(i==7) {
				break;
			
			}
			System.out.println(i);
		}System.out.println(a);
		
		
		
		
		
		
		
		
		
		
	}

}
